import { Link, useParams } from 'react-router-dom'

function ActorList({ actor }) {
  const { actorname } = useParams()
  console.log(actorname)
  const link = `/actors/${slug}`
  return (
    <li>
      <Link to={link}>{actor}</Link>
    </li>
  )
}

export default ActorList
